import { IonGrid, IonRow, IonCol, IonButton } from '@ionic/react';
import React from 'react';

import '../css/Global.css';
import '../css/ProgrammeTalks.css'
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const ProgTalkSchedule: React.FC<{
    day1: any; 
    day2: any;
}> = props => {

    return (
        <>
            <IonGrid id="progTalkSchedule-TableGrid">
                <IonRow id="progTalkSchedule-TableHeader" className="ion-justify-content-center">
                    <IonCol size-sizeSm="3" className="progTalkSchedule-Data ion-text-wrap">Programme Talk</IonCol>
                    <IonCol size-sizeSm="3" className="progTalkSchedule-Data ion-text-wrap">Awarding University</IonCol>
                    <IonCol size-sizeSm="2" className="progTalkSchedule-Data ion-text-wrap">Time</IonCol>
                    <IonCol size-sizeSm="2" className="progTalkSchedule-Data ion-text-wrap">Venue</IonCol>
                    <IonCol size-sizeSm="2" className="progTalkSchedule-Data ion-text-wrap">Add to My Schedule</IonCol>
                </IonRow>

                {props.day1 === 'day1' ? 
                    <IonRow className="ion-justify-content-center">
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">1</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">Day One</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">Sample</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">
                            <IonButton className="progTalkSchedule-DataBtn" size="small" style={{marginTop: "-5%", marginBottom: "-5%"}}>
                                <FontAwesomeIcon icon={faPlus} size="1x"/>
                            </IonButton>
                        </IonCol>
                    </IonRow> : '' 
                }

                {props.day2 === 'day2' ? 
                    <IonRow className="ion-justify-content-center">
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">1</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">Day Two</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">Sample</IonCol>
                        <IonCol className="progTalkSchedule-Data ion-text-wrap">
                            <IonButton className="progTalkSchedule-DataBtn" size="small" style={{marginTop: "-5%", marginBottom: "-5%"}}>
                                <FontAwesomeIcon icon={faPlus} size="1x"/>
                            </IonButton>
                        </IonCol>
                    </IonRow> : '' 
                }
            </IonGrid>
        </>
    );
};

export default ProgTalkSchedule;
